import React from 'react';
import RoomSummary from './RoomSummary';

const RoomList = ({rooms}) => {
    return (
        <div className="section">
            {rooms && rooms.map(room => {
                return (
                    <RoomSummary room={room} />
                )
            })}
        </div>
    );
}
export default RoomList;
